import React, { useState } from 'react';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';
import ProjectItem from './ProjectItem'; // Replace with your content component

export default function ComboBox() {
  const [selectedOption, setSelectedOption] = useState(null);

  // Define your content data
  const allProjects = [
    { label: 'Adho Mukha Svanasana', description: 'Adho Mukha Svanasana is a yoga pose that resembles a dog facing downward and stretching its body. It is also known as the downward-facing dog pose. The pose is named after the Sanskrit phrase "adho mukha svanasana" which translates to "downward-facing dog pose".',photoLink:'data:image/jpeg;base64,'},
{ label:'Adho Mukha Vriksasana', description: "Adho Mukha Vriksasana is a yoga pose thats also known as the handstand or downward-facing tree pose. In this pose, the practitioner stands on their hands, similar to a mountain pose, but upside down. The pose is part of an arm balance sequence that requires both physical and mental engagement." ,photoLink: 'data:image/jpeg;base64,'},
{ label:'Agnistambhasana', description: 'Agnistambhasana, also known as Firelog Pose, is an intermediate-level yoga pose that opens the hips. The name comes from the Sanskrit words "Agni" (fire), "Stambha" (log), and "Asana" (pose). The pose involves sitting with crossed legs and trying to bend forward.' ,photoLink:'data:image/jpeg;base64,'},
{ label:'Ananda Balasana', description: "Ananda Balasana, also known as Happy Baby Pose, is a yoga and Pilates stretch. It's a reclining posture where you lie on your back and grab your feet with your hands. The feet are bent at the knee and in an L-shape." ,photoLink: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcToygaG_x0xoyE64mE2WU6AWx6iShx9WUET_g&usqp=CAU'},
{ label:'Anantasana', description: 'Anantasana is also known as the "sleeping Vishnu Pose". The pose is named after the Hindu god Vishnu, who is often depicted reclining on the cosmic serpent, Ananta.This involves reclining on one side while lying on a yoga mat.The top leg is lifted and held with the top arm.The other hand and leg are stretched straight up, with the fingers grasping the big toe of the raised foot. The supporting arm, body, and lower leg are in a straight line.' ,photoLink:'data:image/jpeg;base64,'},
{ label:'Anjaneyasana', description: 'Anjaneyasana is a yoga pose that involves a deep low lunge. It is also known as the low lunge pose. The pose is named after the mother of the Hindu god Hanuman, who is also called Anjaneya.It is a beginner-friendly yoga pose that is often incorporated into yoga sequences and practices for its stretching and strengthening benefits.' ,photoLink:'data:image/jpeg;base64,'},
{ label:'Ardha Bhekasana', description: 'Ardha Bhekasana is a beginner-level yoga pose that translates to "Half Frog Pose". The name comes from the Sanskrit words "ardha" (half) and "bheka" (frog). The pose is a variation of the full frog pose and is a good pose for runners because of the thigh stretch.' ,photoLink: 'data:image/jpeg;base64,'},
{ label:'Ardha Chandrasana', description: 'Ardha Chandrasana is a yoga pose that is also known as the Half Moon Pose. The name comes from the Sanskrit words "Ardha" (half), "Chandra" (moon), and "Asana" (yoga posture). The pose is a great way to enhance the lunar energies in the body. ' ,photoLink: 'data:image/jpeg;base64,'},
{ label:'Ardha Matsyendrasana', description: 'Ardha Matsyendrasana, often referred to as Half Lord of the Fishes Pose, is a popular yoga asana. It is named after the sage Matsyendra, who is said to be one of the first founders of Hatha Yoga.The pose is practiced to improve posture and restore the digestive system.' ,photoLink: 'data:image/jpeg;base64,'},
{ label:'Ardha Pincha Mayurasana', description: "Ardha Pincha Mayurasana, also known as Dolphin Pose, is a semi-inversion yoga pose that strengthens the upper body and improves flexibility in the hamstrings. It's also a great preparatory pose for intense inversions, like headstand." ,photoLink: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQIWU3Aianc6V9KzF8KuiySGiYG3SuRvg6kLg&usqp=CAU'},
{ label:'Ardha Uttanasana', description: "Ardha Uttanasana is a yoga pose that involves bending the upper body forward until it's almost parallel to the floor. The name comes from the Sanskrit words 'ardha' (half), 'uttana' (intense stretch), and 'asana' (posture). In English, it's called 'standing half forward bend'." ,photoLink: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT-AEzf5Wyu3KQV4dIhRZtSatR4y1UKneClqQ&usqp=CAU'},
{ label:'Ashtanga Namaskara', description: 'Ashtanga Namaskara is a yoga pose also known as the Eight-Limbed Salutation or Eight-Limbed Pose. It is often part of the Surya Namaskar (Sun Salutation) sequence in yoga.' ,photoLink: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQT_9NLIUSCoHCQeP6uT9dfSW2nob3mdVBhsA&usqp=CAU'},
{ label:'Astavakrasana', description: 'Astavakrasana, or Eight-Angle Pose, is an advanced arm balance pose in yoga. The Sanskrit name translates to "eight-angle pose". The pose is named after Ashtavakra, a sage in Hindu mythology who was born with bends or twists in his body.' ,photoLink: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTMW4bbzF9sDOZtWk1s30CnNkbXcXS3Sk5D4g&usqp=CAU'},
{ label:'Baddha Konasana', description: "Baddha Konasana, also known as Bound Angle Pose or Cobbler's Pose, is a yoga pose that opens the hips and stretches the inner thighs. It also strengthens the core, improves posture, and activates the muscles in the back." ,photoLink: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQoKKh9084tDXiarYQBy_EPJGktv7T53x8fFQ&usqp=CAU'},
{ label:'Bakasana', description: 'Bakasana, also known as crane or crow pose, is an intermediate level yoga pose. The name comes from the Sanskrit words "Baka" (crane) and "Asana" (pose). The final position of the pose resembles a crane.' ,photoLink:'data:image/jpeg;base64,'},
{ label:'Balasana', description: "Balasana (Child's pose), is a restorative pose that is known for its calming, grounding, and relaxing effects. It gently stretches the lower back, hips, and thighs, while calming the mind and relieving stress." ,photoLink: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR9-vWQiMcUAVahBYBMaxCV8iDKsMj-4S3ZpA&usqp=CAU'},
    // Add more project data here
  ];

  // Function to handle option selection
  const handleOptionSelect = (option) => {
    setSelectedOption(option);
  };

  // Function to render the list of projects
  const renderProjects = () => {
    if (selectedOption) {
      // Display the selected option content when an option is chosen
      return <ProjectItem project={selectedOption} />;
    } else {
      // Display a list of all projects in rows of 4 cards
      const rows = [];
      for (let i = 0; i < allProjects.length; i += 4) {
        const row = allProjects.slice(i, i + 4);
        rows.push(
          <div
            key={`row-${i}`}
            style={{
              display: 'flex',
              justifyContent: 'space-between',
              marginBottom: '16px', // Adjust the padding as needed
            }}
          >
            {row.map((project) => (
              <div key={project.label} style={{ flex: '1', marginRight: '16px' }}>
                <ProjectItem project={project} />
              </div>
            ))}
          </div>
        );
      }
      return rows;
    }
  };

  return (
    <div style={{marginLeft:70,marginTop:20}}>
      <center>
        <Autocomplete
          disablePortal
          id="combo-box-demo"
          options={allProjects} // Use allProjects as options
          sx={{ width: 300 }}
          onChange={(event, value) => handleOptionSelect(value)} // Handle option selection
          value={selectedOption} // Controlled value for the selected option
          getOptionLabel={(option) => option.label} // Define how to display options in the dropdown
          renderInput={(params) => <TextField {...params} label="Search" />}
        />
      </center>
      <div>{renderProjects()}</div>
    </div>
  );
}
